import menu from './en-US/menu';
import globalHeader from './en-US/globalHeader';

export default {
    'login.login': 'Login',
    'login.email': 'Email',
    'login.password': 'Password',
    'login.register': 'Register',
    'login.loginMethod': 'Other login methods',
    ...menu,
    ...globalHeader
}
